    },
    mapfree: {
      justifyContent: 'center',
      flex:1,
      alignItems: 'center',
      height: 50,
      width: 50,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'white'
    },
  
    mapblock: {
      justifyContent: 'center',
      flex:1,
      alignItems: 'center',
      height: 50,
      width: 50,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'red'
    },
  
    mapworm: {
      justifyContent: 'center',
      flex:1,
      alignItems: 'center',
      height: 50,
      width: 50,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'blue'
    },
  
    startbutton: {
      justifyContent: 'center',
      alignItems: 'center',
      height: 50,
      width: 100,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'blue'
    },
   
    GridViewInsideTextItemStyle: {
   
     color: '#fff',
     fontSize: 18,
     color: "black",
     justifyContent: 'center',
     
   },
  });

  export default styles;
